		<description><![CDATA[3줄 요약 처음으로 개발을 리드하며 진행했는데 많이 힘들었습니다. 스스로 실패했다고 생각했고 2학기 멋사 운영진들한테 고맙고 많이 배웠고 존경합니다.ㅎㅎ규산형은 언제나 자극이 되는 좋은 동료였고 0. 길었지만 금방 지나간 1년이었습니다. 그 시간 동안 제 머리 색은 노란색, 빨간색을 거쳐 다시 검정색으로 돌아왔습니다. 제 주변인들은 알겠지만 머리색보다 저의 멘탈이 더 왔다 갔다 했습니다. 저에게 2017년의 목표는 방만했던 대학 생활을 접고 스스로 [&#8230;]]]></description>
